> The error message `One falsenode is pointing either to itself, either to another tree.` means the conversion went wrong, one tree is pointing to another one when dealing with missing value. This is an issue for onnxmltools. The bug fix may some time as we did not update sparkml converters for more than a year and the conversion first converts the tree into scikit-learn structure before using sklearn-onnx to convert it. I would suggest to use older version of sklearn-onnx to fix it in the mean time.

@xadupre Appreciate your prompt response. Is there any specific version of `onnxmltools` that you would recommend us to downgrade to ? Also could you elaborate the below a bit so that it will facilitate us to check if we can make any tweaks on the model side ?
